import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  const sp = props.expenses.map((value, index) => {
    return (
      <ExpenseItem
        title={value.title}
        amount={value.amount}
        date={value.date}
      ></ExpenseItem>
    );
  });
  return <div>{sp}</div>;
}
export default Expenses;
